const Tesseract = require('tesseract.js');

async function realizarOCR(imagenPath) {
  try {
    const resultadoOCR = await Tesseract.recognize(
      imagenPath,
      'es',
      { logger: info => console.log(info) }
    );

    const textoExtraido = resultadoOCR.data.text;
    console.log('Texto extraído:', textoExtraido);

    // Dividir el texto en líneas
    const lineas = textoExtraido.split('\n');

    // Buscar la línea que contiene "carga útil"
    const lineaCargaUtil = lineas.find(linea => linea.toLowerCase().includes('carga útil'));

    if (lineaCargaUtil) {
      // Extraer el valor numérico de la línea
      const valorNumerico = parseFloat(lineaCargaUtil.match(/\d+/)[0]);

      console.log('Valor numérico de carga útil:', valorNumerico);

      return valorNumerico;
    } else {
      console.log('No se encontró la línea de carga útil');
      return null;
    }
  } catch (error) {
    console.error('Error al realizar OCR:', error);
    throw error;
  }
}

module.exports = { realizarOCR };

