"use strict";

// pdfGenerator.js
var PDFDocument = require('pdfkit');
var fs = require('fs');
function generatePDF(data, outputPath) {
  var doc = new PDFDocument();

  // Lógica para agregar contenido al PDF
  doc.fontSize(16).text('Informe PDF', {
    align: 'center'
  });
  doc.moveDown();

  // Agregar datos al PDF para cada registro
  data.forEach(function (registro) {
    doc.text("Placa: ".concat(registro.placa));
    doc.text("Fecha de Registro: ".concat(registro.fechaRegistro));
    doc.text("Hora de Registro: ".concat(registro.horaRegistro));
    doc.text("Precio: ".concat(registro.precio));
    doc.moveDown(); // Agregar espacio entre registros
  });

  // Guardar el PDF en el archivo de salida
  doc.pipe(fs.createWriteStream(outputPath));
  doc.end();
}
module.exports = generatePDF;
